ULL,9),(10,'2017-02-20 16:00:56','2017-02-20 16:00:56',1,1,'蓋身（貼りナシ・縁ナシ・フラップ三角）','蓋と身が分かれた２ピースタイプ。贈答用（蓋）などに最適。箱の比率が平らな場合に最適。底面がフラットなので底抜け強度が強く、組み立ても簡単。\r\n組み立て後は全ての面がフラットになるためデザインも良く見せることができる。三角フラップなので紙のエッジが見えない\r\n',150.0,35.0,120.0,15,0,0,318.0,288.0,10.0,150.0,10.0,100.0,70.0,NULL,10),(11,'2017-02-20 16:00:56','2017-02-20 16:00:56',1,1,'蓋身（貼りナシ・縁アリ・フラップ三角）','蓋と身が分かれた２ピースタイプ。贈答用（身）などに最適。額があるので高級感UP。箱の比率が平らな場合に最適。底面がフラットなので底抜け強度が強く、組み立ても簡単。組み立て後は全ての面がフラットになるためデザインも良く見せることができる。三角フラップなので紙のエッジが見えない',150.0,35.0,120.0,15,0,0,328.0,296.0,10.0,150.0,10.0,100.0,70.0,NULL,11),(12,'2017-02-20 16:00:56','2017-02-20 16:00:56',1,1,'蓋身（貼りアリ・縁ナシ・サイド貼り）','蓋と身が分かれた２ピースタイプ。贈答用（蓋）などに最適。両サイドが内側に折り曲げられて貼られているため、作業性がよい。組み立て後は全ての面がフラットになるためデザインも良く見せることができる。三角フラップなので紙のエッジが見えない',150.0,35.0,120.0,15,0,0,330.0,260.0,10.0,150.0,10.0,100.0,70.0,NULL,12),(13,'2017-02-20 16:00:56','2017-02-20 16:00:56',1,1,'蓋付き４コーナー貼り（内・内）','TN式よりも作業性を良くしたい場合。納品サイズをコンパクトにしたい場合に。納品時、内側に倒れている側面を起こしてフラップを折り曲げるだけで自立します。両サイド以外はフラットなのでデザインを良く見せることができます。',150.0,35.0,120.0,20,0,0,330.0,260.0,10.0,150.0,10.0,100.0,70.0,NULL,13),(14,'2017-02-20 16:00:56','2017-02-20 16:00:56',1,1,'蓋付き４コーナー貼り（内・外）','TN式よりも作業性を良くしたい場合。納品サイズをコンパクトにしたい場合に。納品時、内側に倒れている側面を起こしてフラップを折り曲げ自立します。、正面は外側に倒れているため内側へ折り曲げ起こす必要があります。両サイド以外はフラットなのでデザインを良く見せることができます。',150.0,35.0,120.0,20,0,0,330.0,260.0,10.0,150.0,10.0,100.0,70.0,NULL,14),(15,'2017-02-20 16:00:56','2017-02-20 16:00:56',1,1,'蓋ナシ４コーナー貼り（内・内）','作業性重視。納品時、内側に倒れている側面を起こすとてフラップが突っ張り自立します。両サイド以外はフラットなのでデザインを良く見せることができます。蓋・身に使用',150.0,35.0,120.0,35,0,0,220.0,190.0,10.0,150.0,10.0,100.0,70.0,NULL,15);
